  alert("this is pass as function through props")
}

function App() {
  return (
    <div className="App">
      <Header info="this is my message" mynumber="5" />
      <p>main content</p>
      <Footer trademark="page by mahidulmoon" myAlert={createAlert} />
    </div>
  );
}

export default App;
